@section('script')
    <script src="{{ asset('assets/js/JQuery/jquery.min.js') }}"></script>
    <script type="application/javascript">
        $(document).ready(function () {
            var textTotalSMASchools = $('#total-sma-schools')
            var textTotalSMKSchools = $('#total-smk-schools')
            var textTotalAdmins = $('#total-admins')

            $.ajax({
                type: 'GET',
                url: "{{ route('api.super-admin.dashboard.index') }}",
                contentType: "application/json",
                dataType: 'json',
                success: function (response) {
                    if (response.status_code === 200) {
                        const amountSMASchools = response.data.amountSMASchools
                        const amountSMKSchools = response.data.amountSMKSchools
                        const amountAdmins = response.data.amountAdmins

                        textTotalSMASchools.text(amountSMASchools)
                        textTotalSMKSchools.text(amountSMKSchools)
                        textTotalAdmins.text(amountAdmins)
                    } else {
                        Swal.fire({
                            icon: 'error',
                            title: response.message
                        })
                    }
                },
                error: function (response) {
                    const responseJson = response.responseJSON

                    Swal.fire({
                        icon: 'error',
                        title: responseJson.message
                    })
                }
            })
        })
    </script>
@endsection
